import styles from './Form.css';
import axios from 'axios';


export default class Form extends React.Component  {
    
    SubmitTo = async () => {
    let user = {
        username:"usernsme",
         password:"password"
      };
      
      let response = await fetch('http://195.242.161.52:8888/login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json" --request POST'
        },
        body: JSON.stringify(user)
      });
      
      let result = await response.json();
      alert(result.message);
    
}   

Submit = async () => {
    let loginData = {
         username:"username",
         password:"password"
     }
     try {
     let response = await axios.post ('http://195.242.161.52:8888/login', loginData)
     console.log(response.data)
     }catch (e) {
         console.log(e)
     }
     }
   render () {
    return (
        <div className='loginForm'>
            <span>Login</span>
            <div class="form-group">
                <input type="login" class="form-control" id="InputEmail" placeholder="Login"/>
            </div>
                <div class="form-group">
                 <input type="password" class="form-control" id="InputPassword" placeholder="Password"/>
            </div>

               <button onClick = {this.SubmitTo} type="submit" class="btn btn-primary">Submit</button>
               <button onClick = {this.Submit} type="button" class="btn btn-info">Инфо</button>
         </div>
    )
    }
}
